import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import Login from './pages/Login';
import Register from './pages/Register';
import VideoUpload from './pages/VideoUpload';
import DetectionResults from './pages/DetectionResults';
import UserManagement from './pages/UserManagement';
import LogManagement from './pages/LogManagement';

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li><Link to="/login">登录</Link></li>
            <li><Link to="/register">注册</Link></li>
            <li><Link to="/upload">视频上传</Link></li>
            <li><Link to="/results">检测结果</Link></li>
            <li><Link to="/users">用户管理</Link></li>
            <li><Link to="/logs">日志管理</Link></li>
          </ul>
        </nav>

        <Switch>
          <Route path="/login" component={Login} />
          <Route path="/register" component={Register} />
          <Route path="/upload" component={VideoUpload} />
          <Route path="/results" component={DetectionResults} />
          <Route path="/users" component={UserManagement} />
          <Route path="/logs" component={LogManagement} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
